import {
  Table,
  TableHeader,
  TableColumn,
  TableBody,
  TableRow,
  TableCell,
  getKeyValue,
} from "@nextui-org/react";

const rowsEmployee = [
  {
    key: "1",
    name: "Tony Reichert",
    address: "Rue de la rue 41 Bruxelles",
    status: "Admin",
  },
  {
    key: "2",
    name: "Zoey Lang",
    address: "Chaussée de waterloo 123 Waterloo",
    status: "Refused",
  },
  {
    key: "3",
