    address: "Avenue Namur 12 Bruxelles",
    status: "Admin",
  },
  {
    key: "4",
    name: "William Howard",
    address: "Rue de eden 41 Uccle",
    status: "Refused",
  },
];

const columnsEmployee = [
  {
    key: "name",
    label: "NAME",
  },
  {
    key: "address",
    label: "ADDRESS",
  },
  {
    key: "status",
    label: "STATUS",
  },
];

const  rowsClient= [
  {
    key: "1",
    name: "Tony Reichert",
    address: "Rue de la rue 41 Bruxelles",
    status: "Admin",
  },
  {
    key: "2",
    name: "Zoey Lang",
    address: "Chaussée de waterloo 123 Waterloo",
    status: "Refused",
  },
  {
    key: "3",
    name: "Jane Fisher",
    address: "Avenue Namur 12 Bruxelles",
    status: "Admin",
  },
  {
    key: "4",
    name: "William Howard",
    address: "Rue de eden 41 Uccle",
    status: "Refused",
  },
];

const columnsClient = [
  {
    key: "name",
    label: "NAME",
  },
  {
    key: "address",
    label: "ADDRESS",
  },
  {
    key: "status",
    label: "STATUS",
  },
];
function DashboardAdmin() {
  return (

    <div>
      <h1>Employees Table</h1>
      {createTable(columnsEmployee,rowsEmployee)}
      

      <h1>Clients Table</h1>
      {createTable(columnsClient,rowsClient)}
      
    </div>
  );
}

function createTable (column,row){
  return(  <Table aria-label="Table">
  <TableHeader columns={column}>
    {(column) => (
      <TableColumn key={column.key}>{column.label}</TableColumn>
    )}
  </TableHeader>
  <TableBody items={row}>
    {(item) => (
      <TableRow key={item.key}>
        {(columnKey) => (
          <TableCell>{getKeyValue(item, columnKey)}</TableCell>
        )}
      </TableRow>
    )}
  </TableBody>
</Table>
);
}

